import React from 'react'
import {BiSearchAlt2} from "react-icons/bi";

const _stylesSearch = {
    iconContainerSearch:{
        width:'100%',
        height:'100%',
        display: 'flex',
        flexDirection: 'row',
        justifyContent: 'center',
        alignItems: 'center',
    },
    contenedorSearch:{
        width:'100%',
        display: 'flex',
        justifyContent: 'flex-start',
        alignItems: 'center',
        borderTopRightRadius:'20px',
        borderBottomRightRadius:'20px',
        borderTopLeftRadius:'20px',
        borderBottomLeftRadius:'20px',

    },
    iconLupa:{
        fontSize:'20px',
    },
    inputTextSearch: {
        width:'100%',
        height:'100%',
    }
    };
function PinSearch() {
    return (
        <div style={_stylesSearch.iconContainerSearch}>
            <div style={_stylesSearch.contenedorSearch} >
            <BiSearchAlt2 style={_stylesSearch.iconLupa}/>
            <input style={_stylesSearch.inputTextSearch} type="text" />
            </div>


        </div>
    )
}

export default PinSearch;
